
pub fn three_sum(mut nums: Vec<i32>) -> Vec<Vec<i32>> {
    use std::collections::{HashMap, HashSet};
    // necessary for deduplication
    nums.sort();

    let mut map = HashMap::<i32, Vec<usize>>::new();
    for (a_i, a) in nums.iter().enumerate() {
        map.entry(*a).or_default().push(a_i);
    }

    let mut output = HashSet::<(i32, i32, i32)>::new();
    for (a_i, a) in nums.iter().enumerate() {
        for (b_i, b) in nums[a_i+1..].iter().enumerate() {
            // fix offset
            let b_i = b_i + a_i + 1;

            // skip if we already output this
            let output_local = (*a, *b, -(a + b));
            if output.contains(&output_local) {
                continue;
            }

            let indicies = map.get(&(-(a + b)));
            if let Some(last_good_index) = indicies {
                let last_good_index = last_good_index.last().unwrap();
                if last_good_index <= &b_i {
                    continue;
                }
                output.insert(output_local);
            }
        }
    }

    output
        .iter()
        .map(|(a, b, c)| [*a, *b, *c].to_vec())
        .collect()
}

